Certain Transactions.

Other than (i) standard employee benefits generally made available to all employees, standard employee offer letters and Confidential Information Agreements (as defined below), (ii) standard director and officer indemnification agreements approved by the Board of Directors, (iii) the purchase of shares of the Company’s capital stock and the issuance of options to purchase shares of the Company’s Common Stock, in each instance, approved in the written minutes of the Board of Directors (previously provided to the Purchasers or their respective counsel), and (iv) the Transaction Documents, there are no agreements, understandings or proposed transactions between the Company and any of its officers, directors, consultants or Key Employees, or any Affiliate thereof. 

The Company is not indebted, directly or indirectly, to any of its directors, officers or employees or to their respective spouses or children or to any Affiliate of any of the foregoing, other than in connection with expenses or advances of expenses incurred in the ordinary course of business or employee relocation expenses and for other customary employee benefits made generally available to all employees. None of the Company’s directors, officers or employees, or any members of their immediate families, or any Affiliate of the foregoing are, directly or indirectly, indebted to the Company[ or, [to the Company’s knowledge], have any (i) material commercial, industrial, banking, consulting, legal, accounting, charitable or familial relationship with any of the Company’s customers, suppliers, service providers, joint venture partners, licensees and competitors, (ii) direct or indirect ownership interest in any firm or corporation with which the Company is affiliated or with which the Company has a business relationship, or any firm or corporation which competes with the Company except that directors, officers, employees or stockholders of the Company may own stock in (but not exceeding two percent (2%) of the outstanding capital stock of) publicly traded companies that may compete with the Company; or (iii) financial interest in any [material] contract with the Company]. 

Rights of Registration and Voting Rights.  Except as provided in the Investors’ Rights Agreement, the Company is not under any obligation to register under the Securities Act any of its currently outstanding securities or any securities issuable upon exercise or conversion of its currently outstanding securities. To the Company’s knowledge, except as contemplated in the Voting Agreement, no stockholder of the Company has entered into any agreements with respect to the voting of capital shares of the Company.

Property.  The property and assets that the Company owns are free and clear of all mortgages, deeds of trust, liens, loans and encumbrances, except for statutory liens for the payment of current taxes that are not yet delinquent and encumbrances and liens that arise in the ordinary course of business and do not materially impair the Company’s ownership or use of such property or assets. With respect to the property and assets it leases, the Company is in compliance with such leases and holds a valid leasehold interest free of any liens, claims or encumbrances other than those of the lessors of such property or assets. The Company does not own any real property. 

Financial Statements.  The Company has delivered to each Purchaser its [unaudited] [audited] financial statements as of [_______ __, 20_] and for the fiscal year ended [_______ __, 20_] [and its unaudited financial statements (including balance sheet, income statement and statement of cash flows) as of [_______ __, 20_] (the “Balance Sheet Date”) and for the [_____]-month period ended on the Balance Sheet Date (collectively, the “Financial Statements”). The Financial Statements have been prepared in accordance with generally accepted accounting principles (“GAAP”) applied on a consistent basis throughout the periods indicated[, except that the unaudited Financial Statements may not contain all footnotes required by GAAP]. The Financial Statements fairly present in all material respects the financial condition and operating results of the Company as of the dates, and for the periods, indicated therein, subject in the case of the unaudited Financial Statements to normal year-end audit adjustments. Except as set forth in the Financial Statements, the Company has no material liabilities or obligations, contingent or otherwise, other than (i) liabilities incurred in the ordinary course of business subsequent to the Balance Sheet Date; (ii) obligations under contracts and commitments incurred in the ordinary course of business; and (iii) liabilities and obligations of a type or nature not required under GAAP to be reflected in the Financial Statements, which, in all such cases, individually and in the aggregate would not have a Material Adverse Effect. The Company maintains and will continue to maintain a standard system of accounting established and administered in accordance with GAAP.

Changes. Since the Balance Sheet Date there has not been:

any change in the assets, liabilities, financial condition or operating results of the Company from that reflected in the Financial Statements, except changes in the ordinary course of business that have not caused, in the aggregate, a Material Adverse Effect;

any damage, destruction or loss, whether or not covered by insurance, that would have a Material Adverse Effect;

any waiver or compromise by the Company of a valuable right or of a material debt owed to it;

any satisfaction or discharge of any lien, claim, or encumbrance or payment of any obligation by the Company, except in the ordinary course of business and the satisfaction or discharge of which would not have a Material Adverse Effect;

any material change to a material contract or agreement by which the Company or any of its assets is bound or subject;

any material change in any compensation arrangement or agreement with any employee, officer, director or stockholder;

any resignation or termination of employment of any officer or Key Employee of the Company; 

any mortgage, pledge, transfer of a security interest in, or lien, created by the Company, with respect to any of its material properties or assets, except liens for taxes not yet due or payable and liens that arise in the ordinary course of business and do not materially impair the Company’s ownership or use of such property or assets;

any loans or guarantees made by the Company to or for the benefit of its employees, officers or directors, or any members of their immediate families, other than travel advances and other advances made in the ordinary course of its business;

any declaration, setting aside or payment or other distribution in respect of any of the Company’s capital stock, or any direct or indirect redemption, purchase, or other acquisition of any of such stock by the Company;

any sale, assignment or transfer of any Company Intellectual Property that could reasonably be expected to result in a Material Adverse Effect;

receipt of notice that there has been a loss of, or material order cancellation by, any major customer of the Company;

[to the Company’s knowledge,] any other event or condition of any character, other than events affecting the economy or the Company’s industry generally, that could reasonably be expected to result in a Material Adverse Effect; or

any arrangement or commitment by the Company to do any of the things described in this Section 2.15.

Employee Matters.

[To the Company’s knowledge,] none of its employees is obligated under any contract (including licenses, covenants or commitments of any nature) or other agreement, or subject to any judgment, decree or order of any court or administrative agency, that would materially interfere with such employee’s ability to promote the interest of the Company or that would conflict with the Company’s business. Neither the execution or delivery of the Transaction Agreements, nor the carrying on of the Company’s business by the employees of the Company, nor the conduct of the Company’s business as now conducted and as presently proposed to be conducted, will, [to the Company’s knowledge,] conflict with or result in a breach of the terms, conditions, or provisions of, or constitute a default under, any contract, covenant or instrument under which any such employee is now obligated. 

The Company is not delinquent in payments to any of its employees, consultants, or independent contractors for any wages, salaries, commissions, bonuses, or other direct compensation for any service performed for it to the date hereof or amounts required to be reimbursed to such employees, consultants or independent contractors. The Company has complied in all material respects with all applicable state and federal equal employment opportunity laws and with other laws related to employment, including those related to wages, hours, worker classification and collective bargaining. The Company has withheld and paid to the appropriate governmental entity or is holding for payment not yet due to such governmental entity all amounts required to be withheld from employees of the Company and is not liable for any arrears of wages, taxes, penalties or other sums for failure to comply with any of the foregoing.

To the Company’s knowledge, no Key Employee intends to terminate employment with the Company or is otherwise likely to become unavailable to continue as a Key Employee. The Company does not have a present intention to terminate the employment of any of the foregoing. The employment of each employee of the Company is terminable at the will of the Company. Except as set forth in Section 2.16(c)(i) of the Disclosure Schedule or as required by law, upon termination of the employment of any such employees, no severance or other payments will become due. Except as set forth in Section 2.16(c)(ii) of the Disclosure Schedule, the Company has no policy, practice, plan or program of paying severance pay or any form of severance compensation in connection with the termination of employment services.

The Company has not made any representations regarding equity incentives to any officer, employee, director or consultant that are inconsistent with the share amounts and terms set forth in the minutes of meetings of (or actions taken by unanimous written consent by) the Company’s Board of Directors. 

Each former Key Employee whose employment was terminated by the Company has entered into an agreement with the Company providing for the full release of any claims against the Company or any related party arising out of such employment.

Section 2.16(f) of the Disclosure Schedule sets forth each employee benefit plan maintained, established or sponsored by the Company, or which the Company participates in or contributes to, which is subject to the Employee Retirement Income Security Act of 1974, as amended (“ERISA”). The Company has made all required contributions and has no liability to any such employee benefit plan, other than liability for health plan continuation coverage described in Part 6 of Title I(B) of ERISA, and has complied in all material respects with all applicable laws for any such employee benefit plan.

[The Company is not bound by or subject to (and none of its assets or properties is bound by or subject to) any written or oral, express or implied, contract, commitment or arrangement with any labor union, and no labor union has requested or, to the knowledge of the Company, has sought to represent any of the employees, representatives or agents of the Company. There is no strike or other labor dispute involving the Company pending, or to the Company’s knowledge, threatened, which could have a Material Adverse Effect, nor is the Company aware of any labor organization activity involving its employees.]

[To the Company’s knowledge, none of the Key Employees or directors of the Company has been (i) subject to voluntary or involuntary petition under the federal bankruptcy laws or any state insolvency law or the appointment of a receiver, fiscal agent or similar officer by a court for his or her business or property; (ii) convicted in a criminal proceeding or named as a subject of a pending criminal proceeding (excluding traffic violations and other minor offenses); (iii) subject to any order, judgment or decree (not subsequently reversed, suspended, or vacated) of any court of competent jurisdiction permanently or temporarily enjoining him or her from engaging, or otherwise imposing limits or conditions on his or her engagement in any securities, investment advisory, banking, insurance, or other type of business or acting as an officer or director of a public company; or (iv) found by a court of competent jurisdiction in a civil action or by the Securities and Exchange Commission or the Commodity Futures Trading Commission to have violated any federal or state securities, commodities, or unfair trade practices law, which such judgment or finding has not been subsequently reversed, suspended, or vacated].

Tax Returns and Payments. There are no federal, state, county, local or foreign taxes due and payable by the Company which have not been timely paid. There are no accrued and unpaid federal, state, country, local or foreign taxes of the Company which are due, whether or not assessed or disputed. There have been no examinations or audits of any tax returns or reports by any applicable federal, state, local or foreign governmental agency. The Company has duly and timely filed all federal, state, county, local and foreign tax returns required to have been filed by it and there are in effect no waivers of applicable statutes of limitations with respect to taxes for any year.

Insurance.  The Company has in full force and effect insurance policies concerning such casualties as would be reasonable and customary for companies like the Company, with extended coverage, sufficient in amount (subject to reasonable deductions) to allow it to replace any of its properties that might be damaged or destroyed. 

Employee Agreements.  Each current and former employee, consultant and officer of the Company has executed an agreement with the Company regarding confidentiality and proprietary information substantially in the form or forms delivered to the Purchasers or their respective counsel (the “Confidential Information Agreements”). No current or former Key Employee has excluded works or inventions from his or her assignment of inventions pursuant to such Key Employee’s Confidential Information Agreement. Each current and former Key Employee has executed a [non-competition and] non-solicitation agreement substantially in the form or forms delivered to the Purchasers or their respective counsel. The Company is not aware that any of its Key Employees is in violation of any agreement described in this Section 2.19.

Permits.  The Company has all franchises, permits, licenses and any similar authority necessary for the conduct of its business, the lack of which could reasonably be expected to have a Material Adverse Effect. The Company is not in default in any material respect under any of such franchises, permits, licenses or other similar authority.

Corporate Documents.  The Certificate of Incorporation and Bylaws of the Company as of the date of this Agreement are in the form provided to the Purchasers. The copy of the minute books of the Company provided to the Purchasers contains minutes of all meetings of directors and stockholders and all actions by written consent without a meeting by the directors and stockholders since the date of incorporation and accurately reflects in all material respects all actions by the directors (and any committee of directors) and stockholders.

